import React from 'react'
import { withCharacter } from './MyProvider'
import {Link} from 'react-router-dom'

const allInfoContainer = () => {
    const mappedinfo = this.props.allInfo.map(info => <Link spellName={info.spell}>{spellName}</Link>)

    return(
        <div>
            {mappedinfo}
        </div>
    )
}

export default withCharacter(allInfoContainer)
